import home from '../assets/img/home.png';
import { MDBCard, MDBCardBody, MDBCardTitle, MDBCardText, MDBCardImage, MDBBtn, MDBRipple } from 'mdb-react-ui-kit';
import'./product.css'
import React, { useState } from 'react';
const Newsection =()=>{
     
    const [scrollableModal, setScrollableModal] = useState(false);
    return (
        <div>
    <MDBCard >
      <MDBRipple rippleColor='light' rippleTag='div' className='bg-image '>
        <MDBCardImage src='' fluid alt='...' />
        
        <a  onClick={() => setScrollableModal(!scrollableModal)} href="#!"  data-mdb-toggle="modal" data-mdb-target="#product_images1">
                          
                          <div className="card-body text-center text-title-box">
                               <h5 className="card-title title-boximage" >Home Page</h5>
                               </div>
                               <img src={home}/>
                           
             </a>
       
      </MDBRipple>
      <MDBCardBody>
        <MDBCardTitle>Card title</MDBCardTitle>
        <MDBCardText>
          Some quick example text to build on the card title and make up the bulk of the card's content.
        </MDBCardText>
        <MDBBtn href='#'>Button</MDBBtn>
      </MDBCardBody>
    </MDBCard>
  

        </div>
    )
}
export default Newsection;
